import React from 'react';
import { Card } from 'react-bootstrap';

export default class Home extends React.Component  {
  render () {
    return (
      <div className="content" >
          <Card>
            <Card.Title>This is a title</Card.Title>
          </Card>
      </div>
    )
  }
}
